import React from "react";

const QRVIEW = () =>{

    return(
        <div className="dashboard-cards">
        {cards.map((card, index) => (
          <div
            key={index}
            className="dashboard-card"
            style={{ backgroundColor: card.color }}
          >
            <div className="card-content">
              <h2>{card.count}</h2>
              <p>{card.label}</p>
            </div>
            <div className="card-icon">
              {card.icon}
            </div>
          </div>
        ))}
      </div>
        
    )

}

export default QRVIEW;
